import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { MyFirst2Component } from './my-first2/my-first2.component';
import { MyFirstModule } from "./my-first/my-first/my-first.module";
import { MyFirst3MModule } from "./my-first3/my-first3-m/my-first3-m.module";
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { NgElseDirective } from './directive_learning/ngElse/ng-else.directive';

@NgModule({
  declarations: [
    AppComponent,
    MyFirst2Component,
    NgElseDirective,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    MyFirstModule,
    MyFirst3MModule,
    BrowserAnimationsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
